The first method to implement is setupScene(), which has the following signature: @Override
protected void setupScene(){ } This method will be called first and must be used to set up the background image, background color and background audio of the scene A typical implementation can look like: @Override
public void setupScene(){ setBackgroundAudio("audio/ocean.mp3"); setBackgroundImage("backgrounds/background1.jpg"); } For more information, check the API of setupGame()

