After setupGame() has been called, Yaeger will call setupScenes(). This is the second step in the life cycle of a Yaeger Game, in which it expects the developer to add Scenes to the Game. Scenes can be added by calling addScene(int, YaegerScene). The first parameter is the id of the YaegerScene, which can be used to select which YaegerScene will be shown. By default, the first scene that is added, will be the first scene that is shown. A typical implementation can ook like: @Override
protected void setupScenes() { addScene(0, new TitleScene(this)); addScene(1, new GameLevel(this)); addScene(2, new GameOverScene(this));
}
